import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {
    Typography, Link, Grid, CssBaseline, Paper, Avatar, TextField, Button
} from '@material-ui/core';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';

// Styles
const useStyles = makeStyles((theme) => ({
    root: {
        height: '100vh',
    },
    image: {
        backgroundImage: 'url(https://source.unsplash.com/random)',
        backgroundRepeat: 'no-repeat',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
    },
    paper: {
        margin: theme.spacing(8, 4),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    avatar: {
        margin: theme.spacing(1),
        backgroundColor: theme.palette.secondary.main,
    },
    form: {
        width: '100%', // Fix IE 11 issue.
        marginTop: theme.spacing(1),
    },
    submit: {
        margin: theme.spacing(3, 0, 2),
    },
}));

// Composant MadeWithLove
const MadeWithLove = () => (
    <Typography variant="body2" color="textSecondary" align="center">
        {'Built with love by the '}
        <Link color="inherit" href="https://material-ui.com/">
            Material-UI
        </Link>
        {' team.'}
    </Typography>
);

// Composant SignInSide
const SignInSide = () => {
    const classes = useStyles();

    return (
        <Grid container component="main" className={classes.root}>
            <CssBaseline />
            <Grid item xs={false} sm={4} md={7} className={classes.image} />
            <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
                <div className={classes.paper}>
                    <Avatar className={classes.avatar}>
                        <LockOutlinedIcon />
                    </Avatar>
                    <Typography component="h1" variant="h5">
                        Sign in
                    </Typography>
                    <form className={classes.form} noValidate>
                        <TextField variant="outlined" margin="normal" required fullWidth id="nom" label="Nom" name="nom" autoFocus />
                        <TextField variant="outlined" margin="normal" required fullWidth id="prenom" label="Prénom" name="prenom" />
                        <TextField variant="outlined" margin="normal" required fullWidth id="email" label="Adresse Email" name="email" autoComplete="email" />
                        <TextField variant="outlined" margin="normal" required fullWidth id="password" label="Mot de Passe" name="password" type="password" />
                        <TextField variant="outlined" margin="normal" required fullWidth id="telephone" label="Téléphone" name="telephone" />
                        <TextField variant="outlined" margin="normal" required fullWidth id="dateNaissance" label="Date de Naissance" name="dateNaissance" type="date" InputLabelProps={{ shrink: true }} />
                        <TextField variant="outlined" margin="normal" required fullWidth id="lieuNaissance" label="Lieu de Naissance" name="lieuNaissance" />
                        <TextField variant="outlined" margin="normal" required fullWidth id="regionResidence" label="Région de Résidence" name="regionResidence" />
                        <TextField variant="outlined" margin="normal" required fullWidth id="profession" label="Profession" name="profession" />
                        <TextField variant="outlined" margin="normal" required fullWidth id="nomEntreprise" label="Nom de l'Entreprise" name="nomEntreprise" />
                        <TextField variant="outlined" margin="normal" required fullWidth id="chiffreAffaire" label="Chiffre d'Affaire" name="chiffreAffaire" type="number" />
                        <Button type="submit" fullWidth variant="contained" color="primary" className={classes.submit}>
                            S'inscrire
                        </Button>
                    </form>
                    <MadeWithLove />
                </div>
            </Grid>
        </Grid>
    );
};

export default SignInSide;
